function getFilters() {
  var urlParams = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
  var transaction = $("#transaction").val().replace("#", "");
  var date_range = $("#date_range").val();

  if (transaction.length > 0) {
    date_range = moment("2018-01-01").format("DD/MM/YYYY") + " - " + moment().format("DD/MM/YYYY");
  }

  var data = {
    project: $("#projeto").val(),
    payment_method: $("#forma").val(),
    status: $("#status").val(),
    client: $("#comprador").val(),
    customer_document: $("#customer_document").val(),
    date_type: $("#date_type").val(),
    date_range: date_range,
    transaction: transaction,
    cashback: $("#cashback").val(),
    plan: $("#plan").val(),
    coupon: $("#cupom").val(),
    company: $(".company-navbar").val(),
    value: parseInt($("#valor").val().replace(/[^\d]+/g, "")) > 0 ? $("#valor").val().replace(/[^\d]+/g, "") : "",
    email_client: $("#email_cliente").val(),
    upsell: $("#upsell").val(),
    order_bump: $("#order-bump").val()
  };
  Object.keys(data).forEach(function (value) {
    if (Array.isArray(data[value])) {
      data[value] = data[value].filter(function (value) {
        return value;
      }).join(",");
    }
  });

  if (urlParams) {
    var params = "";

    for (var param in data) {
      params += "&" + param + "=" + data[param];
    }

    return encodeURI(params);
  } else {
    return data;
  }
}

function salesResume() {
  loadOnAny(".number", false, {
    styles: {
      container: {
        minHeight: "32px",
        height: "auto"
      },
      loader: {
        width: "20px",
        height: "20px",
        borderWidth: "4px"
      }
    }
  });
  $.ajax({
    method: "GET",
    url: "/api/sales/resume",
    data: getFilters(),
    dataType: "json",
    headers: {
      Authorization: $('meta[name="access-token"]').attr("content"),
      Accept: "application/json"
    },
    error: function error(response) {
      loadOnAny(".number", true);
      errorAjaxResponse(response);
    },
    success: function success(response) {
      loadOnAny(".number", true);
      $("#total-sales").html('<span class="font-size-30 bold">0</span>');
      $("#commission, #total").html('<span style="color:#959595">R$</span> <span class="font-size-30 bold">0,00</span>');

      if (response.total_sales) {
        $("#total-sales, #commission, #total").text("");
        var quant = response.total_sales;
        $("#total-sales").html("<span class=\"font-size-30 bold\"> ".concat(quant.toLocaleString("pt-BR"), " </span>"));
        var font_commission_style = "";

        if ("".concat(response.commission).length == 12) {
          font_commission_style = "font-size: 27px !important;";
        } else if ("".concat(response.commission).length > 12) {
          font_commission_style = "font-size: 25px !important;";
        }

        $("#commission").html("<span style=\"color:#959595\">R$</span> <span class=\"font-size-30 bold\" style=\"\n                        ".concat(font_commission_style, " \"> ").concat(response.commission, " </span>"));
        var font_total_style = "";

        if ("".concat(response.total).length == 12) {
          font_total_style = "font-size: 27px !important;";
        } else if ("".concat(response.total).length > 12) {
          font_total_style = "font-size: 25px !important;";
        }

        $("#total").html("<span style=\"color:#959595\">R$</span> <span class=\"font-size-30 bold\" style=\"\n                        ".concat(font_total_style, " \"> ").concat(response.total, " </span>"));
      }
    }
  });
}

function hoverBilletPending() {
  if (verifyAccountFrozen() == true) {
    $(document).on({
      mouseenter: function mouseenter() {
        var status = $(this).attr("status");
        $(this).removeAttr("style");
        $(this).text(status);
      },
      mouseleave: function mouseleave() {
        var status = $(this).attr("status");
        $(this).removeAttr("style");
        $(this).text(status);
      }
    }, ".boleto-pending");
  } else {
    $(document).on({
      mouseenter: function mouseenter() {
        $(this).css("cursor", "pointer").text("Regerar");
        $(this).css("background", "#545B62");
      },
      mouseleave: function mouseleave() {
        var status = $(this).attr("status");
        $(this).removeAttr("style");
        $(this).text(status);
      }
    }, ".boleto-pending");
  }
}

